import Header from '../Header';
import SideNavBar from '../SideNavBar';

import '../../css/common.css';
import DisplayWindow from './DisplayWindow';
import { useEffect } from 'react';

import { baseURL } from '../../sourceData/data';
import { useDispatch} from 'react-redux';

export default function Index() {

  const dispatch =useDispatch()

  async function FetchAdmins() {
    useEffect(() => {
      fetch(`${baseURL}/admins`, {
        method: 'GET',
      })
        .then((response) => response.json())
        .then((resp) => {
          console.log('admins');
          console.log(resp);

          dispatch
          // setAdminList(resp);
          // setSelectedAdminList(resp);
        });

      fetch(`${baseURL}/branches`, {
        method: 'GET',
      })
        .then((response) => response.json())
        .then((resp) => {
          console.log('branches');
          console.log(resp);
          // setBranchesList(resp);
          // setSelectedBranchesList(resp);
        });

      fetch(`${baseURL}/clients`, {
        method: 'GET',
      })
        .then((response) => response.json())
        .then((resp) => {
          console.log('clients');
          console.log(resp);
          // setClientList(resp);
          // setSelectedClientList(resp);
        });

      fetch(`${baseURL}/overviews`, {
        method: 'GET',
      })
        .then((response) => response.json())
        .then((resp) => {
          console.log('overviews');
          console.log(resp);
          // setOverviewData(resp)
        });

      fetch(`${baseURL}/reservations`, {
        method: 'GET',
      })
        .then((response) => response.json())
        .then((resp) => {
          console.log('reservations');
          console.log(resp);
          // setReservationList(resp);
          // setSelectedReservationList(resp);
        });

      fetch(`${baseURL}/staffs`, {
        method: 'GET',
      })
        .then((response) => response.json())
        .then((resp) => {
          console.log('staffs');
          console.log(resp);
          // setStaffList(resp);
          // setSelectedStaffList(resp);
        });
    }, []);
  };

  FetchAdmins();

  setInterval(() => {
    FetchAdmins();
  }, 60000);

  return (
    <div>
      <Header />
      <div className="container-fluid row float-start ">
        <SideNavBar />
        <div class="container-fluid col-10 " id="displayWindow">
          <DisplayWindow />
        </div>
      </div>
    </div>
  );
}
